import "../boostrap/boostrap.css";
import "../../node_modules/bootstrap/dist/js/bootstrap.bundle";
import "./css/Skill.css";

var Skillku = [
  "JavaScript",
  "HTML",
  "CSS",
  "React Js",
  "Bostrap",
  "bulma",
  "materealize",
];

const NameSkill = (props) => {
  return (
    <li id={props.skillname}>
      <div className="skl_li_content">
        <h2>{props.skillname}</h2>
      </div>
    </li>
  );
};

for (let i = 0; i < Skillku.length; i++) {
  const bg_ground = document.getElementById(`${Skillku[i]}`);
  bg_ground.addEventListener("click", () => {
    alert("berhasil di klik");
  });
}

const Skill = () => {
  return (
    <>
      <h1 className="skl_head">My Skill</h1>
      <ul className="skl_container_element">
        {Skillku.map((skills) => (
          <NameSkill skillname={skills} />
        ))}
      </ul>
    </>
  );
};

export default Skill;
